import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const Main = () => {
    return (
        <Container fluid >
            <Row>
                <Col>
                    Hello world
                </Col>
            </Row>
        </Container>
    )
}

export default Main;
